from functools import reduce

data = ""

def series_max(data, size):
    res = 0
    for i in range(len(data)-size+1):
        part = data[i:i+size]
        prod = reduce(lambda a,b: int(a)*int(b), part, 1)
        if(prod > res):
            res = prod
    return res

def main():
    size = 13
    res = series_max(data,size)
    print(res)

if __name__ == "__main__":
    main()
